import React from "react";

const Navbar = () => {
  let Links = [
    { name: "ABOUT", link: "/" },
    { name: "PROJECTS", link: "/" },
    { name: "CONTACT", link: "/" },
  ];
  return (
    <div className="w-full fixed top-0 left-0">
      <div className="items-center justify-between py-10 md:px-40 px-7">
        <div className="text-2xl text-white font-merriweather font-bold">
          <a href="/" className="hover:text-gray-400 duration-300">
            BARA KHARSEH
          </a>
        </div>
      </div>
      <ul className="text-white font-merriweathermd:items-center">
        {Links.map((link) => (
          <li key={link.name} className="md:ml-8 text-xl">
            <a href={link.link} className="hover:text-gray-400 duration-300">
              {link.name}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Navbar;
